export function ProductList(props) {
    console.log(props)
    return <div className="col-md-6">
        <h3>Praducts</h3>
        <div className="row">
            {
                props.data.map(elm => {
                    return <div className="col-md-3" key={elm.id} >
                        {
                props.data.map(elm => {
                    return <div className="col-md-3" key={elm.id} >
                        <tr>
                            <td>{elm.title}</td>
                            <td>{elm.price}</td>
                            <td>{elm.category}</td>
                            <td>{elm.count}</td>
                            <td><img src={elm.image}/></td>
                        </tr>
                        <button onClick={() => props.onMove(elm.id)}>Dalete</button>


                    </div>
                })
            }
                    </div>
                })
            }

        </div>
    </div>
}
